import React from "react";
import { Panel, Table } from "rsuite";
import { connect } from "react-redux";
import ProjectTable from "./projectTable";

const Home = ({ projects }) => {
  const imgStyles = {
    height: "20rem",
    width: "100%",
  };

  const homeContainer = {
    padding: "1.3rem",
    display: "flex",
    justifyContent: "space-between",
  };

  const rightPanelStyles = {
    display: "flex",
    flexFlow: "row wrap",
    justifyContent: "space-around",
  };

  const internalRightStyles = {
    marginBottom: "1rem",
    width: "48%",
  };



  return (
    <div style={homeContainer}>
      <div className="leftSide">
        <Panel shaded bordered bodyFill>
          <img style={imgStyles} src="https://via.placeholder.com/500" />
          <Panel header="Latest Changes">
            <ProjectTable/>
          </Panel>
        </Panel>
      </div>
      <div className="rightSide">
        <Panel
          shaded
          bordered
          bodyFill
          style={{padding: "1rem",}}
        >
          <div style={rightPanelStyles}>
            {projects.map((project) => (
              <Panel
                header={project.project_title}
                style={internalRightStyles}
                collapsible
                bordered
              >
                <p>Place hodler data, to be filled on backend update.</p>
              </Panel>
            ))}
          </div>
        </Panel>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    projects: state.projects_data.projects,
  };
};

export default connect(mapStateToProps, {})(Home);
